import './App.css';
import Navbar from './components/Navbar';
import {BrowserRouter as Router, Switch, Route } from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Switch>
          <Route path='/' exact/>
        </Switch>
      </Router>

      <h1>Yo save</h1>
    </div>
  );
}

export default App;
